import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <input type="text" />
      <button>Add</button>
      <ul>
        <li>Item 1 <button>Delete</button></li>
      </ul>
    </div>
  );
}

export default App;
